Here is a sample Spark job to calculate the hit rate for onsite attributed data:
```
// Load the onsite attributed data and top frequent queries into JavaRDDs
JavaRDD<String> onsiteData = ...;
JavaRDD<String> topFrequentQueries = ...;

// Create a JavaPairRDD to store the cache hits and misses
JavaPairRDD<String, Integer> cacheHitsMisses = javaSparkContext.parallelizePairs(new ArrayList<>());

// Iterate through the onsite attributed data
for (String record : onsiteData.collect()) {
  String[] fields = record.split(",");
  String query = fields[0];

  // Check if the query is present in the top frequent queries
  if (topFrequentQueries.contains(query)) {
    // Check if it's the first time the query is seen
    boolean isFirstTime = true;
    for (String hitMiss : cacheHitsMisses.keys()) {
      if (hitMiss.equals(query)) {
        isFirstTime = false;
        break;
      }
    }

    // If it's the first time, count it as a cache miss
    if (isFirstTime) {
      cacheHitsMisses.put(query, 0);
    }

    // Increment the cache hit count
    int cacheHitCount = cacheHitsMisses.lookup(query);
    cacheHitsMisses.put(query, cacheHitCount + 1);
  }
}

// Calculate the hit rate
long totalQueries = onsiteData.count();
long totalCacheHits = cacheHitsMisses.values().reduce((a, b) -> a + b);
double hitRate = (double) totalCacheHits / totalQueries;

System.out.println("Hit rate: " + hitRate);
```
In this example, the onsite attributed data and top frequent queries are loaded into JavaRDDs. A JavaPairRDD is used to store the cache hits and misses, with the query as the key and the count of cache hits as the value. The onsite attributed data is iterated through, and for each record, the query is checked to see if it is present in the top frequent queries. If it is, the system checks if it's the first time the query is seen. If it is, it counts it as a cache miss and adds it to the cacheHitsMisses JavaPairRDD. If it's not the first time, it increments the cache hit count for that query in the cacheHitsMisses JavaPairRDD. Finally, the hit rate is calculated by dividing the total cache hits by the total number of queries.

It's worth noting that this is a simple example and it doesn't take into account the 12 hours cache time. To do that, you would need to add a timestamp to the cacheHitsMisses JavaPairRDD and check if the current timestamp is within 12 hours of the last cache hit timestamp for that query. If it is, you can increment the cache hit count, otherwise, you would count it as a cache miss.

